import React, { Component } from 'react';
import './App.css';
import Header from './components/header';
import Footer from './components/footer';
import Search from './components/search';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Header />
        <Search />
        <Footer />
      </div>
    );
  }
}

export default App;
